// src/EmployeeForm.jsx
import React, { useState } from "react";
import axios from "axios";

const EmployeeForm = () => {
    const [employeeData, setEmployeeData] = useState({
        name: "",
        employeeId: "",
        email: "",
        phoneNumber: "",
        department: "",
        dateOfJoining: "",
        role: "",
    });
    const [errors, setErrors] = useState({});
    const [message, setMessage] = useState("");

    const handleChange = (e) => {
        const { name, value } = e.target;
        setEmployeeData({
            ...employeeData,
            [name]: value,
        });
    };

    const validateForm = () => {
        const newErrors = {};
        // Name validation
        if (!employeeData.name) newErrors.name = "Name is required";
        // Employee ID validation (must be alphanumeric and max 10 characters)
        if (!employeeData.employeeId.match(/^[a-zA-Z0-9]{1,10}$/))
            newErrors.employeeId = "Employee ID must be alphanumeric and max 10 characters";
        // Email validation (basic format check)
        if (!/\S+@\S+\.\S+/.test(employeeData.email))
            newErrors.email = "Email is invalid";
        // Phone number validation (10 digits)
        if (!/^\d{10}$/.test(employeeData.phoneNumber))
            newErrors.phoneNumber = "Phone number must be 10 digits";
        // Department validation
        if (!employeeData.department) newErrors.department = "Department is required";
        // Date of Joining validation (can't be a future date)
        if (new Date(employeeData.dateOfJoining) > new Date())
            newErrors.dateOfJoining = "Date of Joining can't be in the future";
        // Role validation
        if (!employeeData.role) newErrors.role = "Role is required";

        setErrors(newErrors);
        return Object.keys(newErrors).length === 0;
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        if (validateForm()) {
            axios
                .post("http://localhost:3001/add-employee", employeeData)
                .then((response) => {
                    setMessage("Employee added successfully");
                    setEmployeeData({
                        name: "",
                        employeeId: "",
                        email: "",
                        phoneNumber: "",
                        department: "",
                        dateOfJoining: "",
                        role: "",
                    });
                })
                .catch((error) => {
                    setMessage(error.response?.data?.message || "Error adding employee");
                });
        }
    };

    return (
        <div>
            <h2>Add Employee</h2>
            {message && <p>{message}</p>}
            <form onSubmit={handleSubmit}>
                <div>
                    <label>Name</label>
                    <input
                        type="text"
                        name="name"
                        value={employeeData.name}
                        onChange={handleChange}
                    />
                    {errors.name && <p>{errors.name}</p>}
                </div>
                <div>
                    <label>Employee ID</label>
                    <input
                        type="text"
                        name="employeeId"
                        value={employeeData.employeeId}
                        onChange={handleChange}
                    />
                    {errors.employeeId && <p>{errors.employeeId}</p>}
                </div>
                <div>
                    <label>Email</label>
                    <input
                        type="email"
                        name="email"
                        value={employeeData.email}
                        onChange={handleChange}
                    />
                    {errors.email && <p>{errors.email}</p>}
                </div>
                <div>
                    <label>Phone Number</label>
                    <input
                        type="text"
                        name="phoneNumber"
                        value={employeeData.phoneNumber}
                        onChange={handleChange}
                    />
                    {errors.phoneNumber && <p>{errors.phoneNumber}</p>}
                </div>
                <div>
                    <label>Department</label>
                    <select
                        name="department"
                        value={employeeData.department}
                        onChange={handleChange}
                    >
                        <option value="">Select Department</option>
                        <option value="HR">HR</option>
                        <option value="Engineering">Engineering</option>
                        <option value="Marketing">Marketing</option>
                    </select>
                    {errors.department && <p>{errors.department}</p>}
                </div>
                <div>
                    <label>Date of Joining</label>
                    <input
                        type="date"
                        name="dateOfJoining"
                        value={employeeData.dateOfJoining}
                        onChange={handleChange}
                    />
                    {errors.dateOfJoining && <p>{errors.dateOfJoining}</p>}
                </div>
                <div>
                    <label>Role</label>
                    <input
                        type="text"
                        name="role"
                        value={employeeData.role}
                        onChange={handleChange}
                    />
                    {errors.role && <p>{errors.role}</p>}
                </div>
                <div>
                    <button type="submit">Submit</button>
                    <button type="reset" onClick={() => setEmployeeData({})}>Reset</button>
                </div>
            </form>
        </div>
    );
};

export default EmployeeForm;
